	(7,'','Story creation using Paruto','Adamawa','<p>Starting in Foundation 5 there&#39;s no longer a Compass extension. Instead we use&nbsp;<a href=\"http://bower.io/\">bower</a>&nbsp;to keep Foundation assets up to date within your project. Here&#39;s how you can update your project:</p>',NULL,NULL,1,2,1,0,0,'2014-12-28 22:20:03','2014-12-28 22:20:03',NULL),
