	(10,'','This is the Chromeo speaking','Taraba','<p>Far from killing it, jQuery&#39;s given Javascript a new life. Do new C#/Java programmers understand pointers? No. Do they need to? Not really, newer abstractions are powerful enough for it not to matter</p>',NULL,NULL,0,3,0,1,2,'2014-12-28 22:48:03','2014-12-28 22:48:03',NULL),
	(11,'image','Children Killed in Adamawa State','Adamawa','<p>Boko Haram kills 45 in Fresh Borno state Attacks, No fewer than 45 people were killed by Boko Haram members in an attack on Azaya Kura village in the Mafa local government area of Borno state on Wednesday November 19th.&nbsp;According to residents of the village who fled to Maiduguri the state capital for safety, the sect members arrived their village at about 12noon on motorcycles, shooting anyone in sight.&nbsp;&ldquo;So far, 45 men have been killed and there are others that died in the bushes as a result of bleeding from bullet wounds,&rdquo; said one resident&nbsp;Confirming the attack, the caretaker of Mafa Local Government area, Shettima Lawan described it as wicked and appealed to the federal government to act fast in helping them.&nbsp;</p>',X'','',0,3,0,0,3,'2014-12-29 01:09:17','2014-12-29 01:09:17',NULL);

